def degrees(x):
        radians = math.atan2(x)
        return radians * 180 / math.pi

    return sorted([x for x in input_list if isprime(x)], key=degrees)

if not input_list:
        return []
    prime_num = []
    for item in input_list:
        if isprime(item):
            prime_num.append(item)
    return sorted(prime_num, key=lambda x: math.degrees(math.asin(1 / x)))

